                </span>
                </div>

                <div>
                    <Link href="/forgot-password" className="text">
                    forgot password?
                    </Link>

                </div>

                <button type="submit" className="login-btn" >
                    Login
                </button>

                <p>
                    Don't have an account ?{''}
